Here is the Solidity contract code based on your description:

```solidity
pragma solidity ^0.6.12;

contract ExampleContract {
    string public name;
    uint8 public decimals;
    string public symbol;
    address payable public _owner;
    address payable public _premine;
    address payable public _dev;
    address payable public _devfeesaddr;
    uint256 public _tokepereth;
    bool private paused1;
    bool private paused;
    bool public _receiveeth;
    bool public _coldstorage;
    uint256 private price;
    uint256 public lifeval;
    uint256 private totalSupply1;
    uint256 private totalSupply;
    uint256 public _totalsupply;
    uint256 public _circulatingsupply;
    uint256 public _frozentokens;
    mapping (address => uint256) public balanceof;
    mapping (address => uint256) public exchangepartners;
    mapping (address => uint256) public contractexchangerate;

    constructor() public payable {
        _owner = msg.sender;
        _premine = 0x76D05E325973D7693Bb854ED258431aC7DBBeDc3;
        _dev = 0xC96CfB18C39DC02FBa229B6EA698b1AD5576DF4c;
        _devfeesaddr = _dev;
        _tokepereth = 0x274d48fed3e8000;
        _coldstorage = true;
        _receiveeth = true;
        paused = false;
        paused1 = false;
        lifeval = 0;
        totalSupply1 = 0;
        totalSupply = 0;
        _totalsupply = 0x152d02c7e14af6800000;
        _circulatingsupply = 0;
        _frozentokens = 0;
        if (msg.value == 0) {
            balanceof[_premine] = 0x6eac27823bcbceb0000;
        }
    }

    function changeDevFeesAddr(address newDevFeesAddr) public {
        require(msg.sender == _dev, "Only the dev can call this function");
        _devfeesaddr = payable(newDevFeesAddr);
    }

    function withdrawDevFees() public {
        require(paused1 != false, "Withdrawal is paused");
        _devfeesaddr.transfer(totalSupply);
        totalSupply = 0;
    }

    function addExchangePartnerTargetAddress(address partnerAddress) public {
        require(msg.sender == _dev || msg.sender == _owner, "Only the owner or dev can call this function");
        exchangepartners[partnerAddress] = 1;
    }

    function addExchangePartnerAddressAndRate(address partnerAddress, uint256 rate) public {
        require(msg.sender == _dev || msg.sender == _owner, "Only the owner or dev can call this function");
        contractexchangerate[partnerAddress] = rate;
    }

    function toggleReceiveEth() public {
        require(msg.sender == _dev, "Only the dev can call this function");
        _receiveeth = !_receiveeth;
    }

    function defrostFrozenTokens() public {
        require(_totalsupply + _frozentokens >= _totalsupply, "Overflow detected");
        if (msg.sender == _dev || msg.sender == _owner) {
            _totalsupply += _frozentokens;
            _frozentokens = 0;
        }
    }

    function changeDev(address newDev) public {
        require(msg.sender == _dev, "Only the dev can call this function");
        _owner = payable(newDev);
    }

    function updateFeeAmount(uint256 newFeeAmount) public {
        require(msg.sender == _dev || msg.sender == _owner, "Only the owner or dev can call this function");
        price = newFeeAmount * 100;
    }

    function toggleFreezeTokensFlag() public {
        require(msg.sender == _dev || msg.sender == _owner, "Only the owner or dev can call this function");
        _coldstorage = !_coldstorage;
    }

    function payFeesToggle() public {
        require(msg.sender == _dev || msg.sender == _owner, "Only the owner or dev can call this function");
        paused1 = !paused1;
    }

    function changeOwner(address newOwner) public {
        require(msg.sender == _owner, "Only the owner can call this function");
        _dev = payable(newOwner);
    }

    function removeExchangePartnerTargetAddress(address partnerAddress) public {
        require(msg.sender == _dev || msg.sender == _owner, "Only the owner or dev can call this function");
        exchangepartners[partnerAddress] = 0;
    }

    function safeWithdrawal(address payable recipient, uint256 value) public {
        require(msg.sender == _owner, "Only the owner can call this function");
        require(value * 1 ether <= address(this).balance, "Insufficient contract balance");
        recipient.transfer(value * 1 ether);
    }

    function changePayRate(uint256 newRate) public {
        require(msg.sender == _owner, "Only the owner can call this function");
        _tokepereth = newRate;
    }

    fallback() external payable {
        require(msg.value > 0, "No zero value allowed");
        uint256 amount = msg.value * _tokepereth;
        require(balanceof[_owner] >= amount, "Insufficient contract balance");
        balanceof[_owner] -= amount;
        balanceof[msg.sender] += amount;
    }
}
```

